    personalizedList(first: $first, listUri: $listUri, personalizedListContext: {assetUri: $assetUri}) {
      edges {
        trackingParams {
          key
          value
        }
        node {
          __typename
          ... on Recipe {
            url
            headline {
              default
            }
            bylines {
              renderedRepresentation
            }
            totalTimeDisplay
            promotionalMedia {
              __typename
              ... on Image {
                crops(renditionNames: ["mediumThreeByTwo252","videoSixteenByNine310","mediumThreeByTwo210","mediumThreeByTwo440","mediumThreeByTwo252","mediumThreeByTwo378","largeHorizontal375"]) {
                  renditions {
                    name
                    url
                    width
                    height
                  }
                }
              }
              ... on Video {
                promotionalMedia {
                  __typename
                  ... on Image {
                    crops(renditionNames: ["mediumThreeByTwo252","videoSixteenByNine310","mediumThreeByTwo210","mediumThreeByTwo440","mediumThreeByTwo252","mediumThreeByTwo378","largeHorizontal375"]) {
                      renditions {
                        name
                        url
                        width
                        height
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }
}","operationName":"CookingRecirculationCarousel","variables":{"first":20,"listUri":"nyt://per/personalized-list/cooking-carousel","assetUri":"nyt://recipe/75e81307-e454-5bf7-982d-87eda7c31587"}}
